import React from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

import "./routesCss/Home.css";

const Home = () => {
	return (
		<div className="homeContainer">
			<Navbar />
			<div className="backgroundImageHolder"></div>
			<div className="aboveHomeBanner">
				<h1>Timothy Jackreece</h1>
				<p>Full-Stack Web Developer</p>
			</div>
			<div className="cardsHome">
				<div id="hc1" className="homeCard">
					<div></div>
					<div></div>
				</div>
				<div id="hc2" className="homeCard">
					<div></div>
					<div></div>
				</div>
				<div id="hc3" className="homeCard">
					<div></div>
					<div></div>
				</div>
			</div>
			<Footer />
		</div>
	);
};

export default Home;
